      async function aj(ws) {
        return await fetch("https://jsonplaceholder.typicode.com/users")
          .then(response => response.json())
          .then(json => {
            debugger;
            console.log("data=>", json);
            json = json.map(d => {
              d.base64 =
                "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAALQAAAC0CAYAAAA9zQYyAAAABGdBTUEAALGPC/xhBQAAAAlwSFlzA...";
              return d;
            });
            var col = Object.keys(json[0]).map(dd => {
              return {
                key: dd,
                header: dd,
                width: 20,
              };
            });
            ws.columns = JSON.parse(JSON.stringify(col));
            ws.addRows(json);
          });
      }
      async function RunExcelJSExport() {
        let wb = new ExcelJS.Workbook();
        let workbookName = "Sample Workbook Generated by ExcelJS.xlsx";
        let worksheetName = "Demo Worksheet";
        let ws = wb.addWorksheet(worksheetName, {
          properties: {
            tabColor: { argb: "FFFF0000" },
          },
        });

        img(ws, wb, 0, 0);
        await aj(ws);
        wb.xlsx.writeBuffer().then(function (buffer) {
          saveAs(
            new Blob([buffer], { type: "application/octet-stream" }),
            workbookName
          );
        });
      }
      RunExcelJSExport();
